    const [loaded, setLoaded] = useState(false);

    const handling = (value) => {
        setData(value);
    }
    // initializing url
    const domain = 'https://openexchangerates.org/api/historical/';
    const endpoint = '.json?app_id=01341f5261444649a612793df73c7130';
    const url = `${domain}${date}${endpoint}`;
    console.log('url: ' + url);
    console.log('log date: ' + date);

    console.log('2:' + data);

    const load = () => {
        console.log('---22222222----------------')
        console.log(data);
    }

    useEffect(() => {
        if (loaded == false) {
            console.log('TEST');
            setData(UseFetchExchange(url));
            setLoaded(true);
        } else {
            console.log('TEST RESULT CALCULATING LATER!');
        }
    }, [loaded]);


    return (
        <>
            {data &&
                <p>{data.timestamp}</p>
            }
        </>
    )
}
